await inject(app, {
    method: "POST",
    url: "/dicom-web/mwlitems/status/READY?ScheduledProcedureStepSequence.ScheduledStationName=USA",
    headers: {
        "Content-Type": "application/dicom+json"
    }
});
let response = await inject(app, {
    method: "GET",
    url: "/dicom-web/mwlitems",
    headers: {
        "Content-Type": "application/dicom+json"
    }
});
let mwlItems = await response.json();
expect(mwlItems).to.be.a("array");
expect(mwlItems).have.lengthOf(2);
let usaMwlItem = mwlItems.find(mwlItem => mwlItem[dictionary.keyword.ScheduledProcedureStepSequence]["Value"][0][dictionary.keyword.ScheduledStationName]["Value"][0] === "USA");
expect(usaMwlItem)
.have.property(dictionary.keyword.ScheduledProcedureStepSequence)
.have.property("Value")
.have.property("0")
.have.property(dictionary.keyword.ScheduledProcedureStepStatus)
.have.property("Value")
.have.property("0")
.to.be.equal("READY");
let ggMwlItem = mwlItems.find(mwlItem => mwlItem[dictionary.keyword.ScheduledProcedureStepSequence]["Value"][0][dictionary.keyword.ScheduledStationName]["Value"][0] === "GG");
expect(ggMwlItem)
.have.property(dictionary.keyword.ScheduledProcedureStepSequence)
.have.property("Value")
.have.property("0")
.have.property(dictionary.keyword.ScheduledProcedureStepStatus)
.have.property("Value")
.have.property("0")
.to.be.equal("SCHEDULED");

